import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
  return (
    <div style={styles.page}>
      <link
        href="https://fonts.googleapis.com/css2?family=Quicksand:wght@500;700&display=swap"
        rel="stylesheet"
      />
      <div style={styles.container}>
        <div style={styles.icon}>üêæ</div>
        <h1 style={styles.title}>Walky Loving Dogs</h1>
        <p style={styles.subtitle}>Aplica√ß√£o de Creche para Cachorros</p>
        <div style={styles.buttonGroup}>
          <Link to="/pets" className="btn btn-primary" style={styles.button}>Ver Pets</Link>
          <Link to="/admins" className="btn btn-info" style={styles.button}>Ver Admins</Link>
          <Link to="/donos" className="btn btn-purple" style={{ ...styles.button, backgroundColor: '#7e22ce', borderColor: '#7e22ce' }}>Ver Donos</Link>
          <Link to="/tutores" className="btn btn-success" style={styles.button}>Ver Tutores</Link>
        </div>
      </div>
    </div>
  );
};

const styles = {
  page: {
    fontFamily: "'Quicksand', sans-serif",
    minHeight: '100vh',
    background: 'linear-gradient(to bottom, #fdfdfd, #f0f4f8)',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  container: {
    textAlign: 'center',
  },
  icon: {
    fontSize: '2rem',
    marginBottom: '0.5rem',
  },
  title: {
    fontWeight: '700',
    fontSize: '2.5rem',
    marginBottom: '0.5rem',
    color: '#333',
  },
  subtitle: {
    fontSize: '1.1rem',
    marginBottom: '2rem',
    color: '#555',
  },
  buttonGroup: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: '1rem',
  },
  button: {
    minWidth: '120px',
    fontWeight: '600',
    transition: 'all 0.3s ease',
  },
};

export default Home;
